descrip:
Iowa Department of Transportation 511 feature layer. Updated every 10 minutes. Events can be found on the Iowa 511 website: http://www.511ia.org/
Note: This is an Esri Feature Collection which is different than an Esri Feature Service. Feature Collections allow for high-availability. There are unique characteristics that need to be considered when using this data type: 
1) It is a file-based data type so there is no REST endpoint. However, there is JSON that can parsed out. See link at the bottom of this page.; 
2) You cannot set a refresh interval in the map document, you must use the Info Summary Widget inside an application or hard-code the refresh in a custom application.; 
3) The rotation setting gets wiped out each time the dataset is updated. When you add a feature collection to a new map, you will have to set the rotation. If you have an existing saved map this doesn?t apply to you.
